     , (11810, 6 /* Give_EmoteCategory */, 67, 3, 10 /* Tell_EmoteType */, 1, 1, NULL, 'The library seems to be caked in madness and filth. Remnants of a Shadow Bulwark perhaps? Soot-layered tombs and air that maddens.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 67, 4, 10 /* Tell_EmoteType */, 1, 1, NULL, 'Now I see why the Raven Hand sought this place out. There may be artifacts of powerful shadows within.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 67, 5, 10 /* Tell_EmoteType */, 1, 1, NULL, 'It seems, though, that Yalik has done well in guarding the place. This is a hugely important task for one as young as he. I wonder how well he will handle the task in the months to come.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 67, 6, 18 /* DirectBroadcast_EmoteType */, 1, 1, NULL, 'Ufet nearly forgets you in his musing, but quickly returns to the matter at hand.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 67, 7, 10 /* Tell_EmoteType */, 1, 1, NULL, 'I thank you for this. We were right to suspect the Order of the Raven Hand were up to no good. Take this as a reward for your efforts.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
