     , (11810, 6 /* Give_EmoteCategory */, 68, 2, 10 /* Tell_EmoteType */, 1, 1, NULL, 'This came from the Shadow''s Garb worn by Rayssid Ibn Alhath? Sadly I know little of the man save for his affinity for ranged weapons.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 68, 3, 10 /* Tell_EmoteType */, 1, 1, NULL, 'It seems only fitting that the reward I give you should reflect that. Take this periapt. May it help guide your shots with accuracy and swiftness.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
