     , (11810, 6 /* Give_EmoteCategory */, 69, 2, 10 /* Tell_EmoteType */, 1, 1, NULL, 'Ah, Tiyol''s tassel, correct? I had no liking for that contemptuous man. In fact, it would not surprise me at all if he was the first to fall under the sway of the Raven Hand.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 69, 3, 10 /* Tell_EmoteType */, 1, 1, NULL, 'You did the world a great justice by defeating him. And since he was such a vile man, I have no qualms about giving out his belongings.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 69, 4, 10 /* Tell_EmoteType */, 1, 1, NULL, 'Before the group left for the library, many of them entrusted some of their belongings to my care. Primarily items that would be of no use to them in the grasslands and forests north of here.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 69, 5, 10 /* Tell_EmoteType */, 1, 1, NULL, 'Tiyol left this Cowl. Here, take it. I am glad to be rid of his belongings. Surely you will put the Cowl to a more appropriate use.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
