     , (11810, 6 /* Give_EmoteCategory */, 70, 2, 10 /* Tell_EmoteType */, 1, 1, NULL, 'You say Rheth Al'' Thok wore this upon his Shadow''s Garb? He was a bright man, poised to enter the ranks of the Zaikhal Arcanum. Well... that was before my compatriots offered him a place within our ranks. A shame that he was so easily enticed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 70, 3, 10 /* Tell_EmoteType */, 1, 1, NULL, 'Since he joined the ranks of the Zharalim, he was striving to obtain the Shagraka- the casting focus used by many of the Zharalim''s sorcerers.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 6 /* Give_EmoteCategory */, 70, 4, 10 /* Tell_EmoteType */, 1, 1, NULL, 'As he is no longer with us, the focus reserved for his use shall be passed on to you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
