     , (11810, 7 /* Use_EmoteCategory */, 0, 7, 10 /* Tell_EmoteType */, 1, 1, NULL, 'You''ll pardon me if my mind is on other matters today. Several of my comrades have left for a recently discovered library north west of this city, but they have not yet returned.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 7 /* Use_EmoteCategory */, 0, 8, 10 /* Tell_EmoteType */, 1, 1, NULL, 'I am not usually one to worry, but with all that has happened of late, assassinations, invasions and an increase in cult activity, I can''t help but do so.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (11810, 7 /* Use_EmoteCategory */, 0, 9, 10 /* Tell_EmoteType */, 1, 1, NULL, 'I must remain at my station, but if you happen to come across them, please let me know where they are. Any information you find will put my mind at ease.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);

